import React, { Component } from "react";
import User from "../components/User";

class Users extends Component {
  render() {
    return (
      <div>
        {this.props.users.map((user) => {
          return (
            <User
              key={user.id}
              name={user.name}
              jobTitle={user.jobTitle}
              salary={user.salary}
            />
          );
        })}
      </div>
    );
  }
}
export default Users;
